import { useEffect, useState } from "react";

export default function SellerManageBookings() {
  const [bookings, setBookings] = useState([]);

  // Mock data (replace with API later)
  useEffect(() => {
    setBookings([
      {
        id: "BKG1023",
        customerName: "John Doe",
        flightNo: "DL245",
        from: "JFK",
        to: "LAX",
        date: "2025-01-14",
        seats: 2,
        total: 598,
      },
      {
        id: "BKG1024",
        customerName: "Sarah Khan",
        flightNo: "AA110",
        from: "ORD",
        to: "MIA",
        date: "2025-02-02",
        seats: 1,
        total: 320,
      },
    ]);
  }, []);

  const handleDelete = (id) => {
    if (!window.confirm("Are you sure you want to delete this booking?")) return;
    setBookings(bookings.filter((b) => b.id !== id));
  };

  const handleEdit = (id) => {
    alert("Navigate to Edit Booking Page for: " + id);
  };

  const handleView = (id) => {
    alert("Viewing booking: " + id);
  };

  return (
    <div style={styles.page}>
      <main style={styles.hero}>
        <div style={styles.heroInner}>

          <h2 style={styles.title}>Manage Bookings</h2>

          <div style={styles.sectionCard}>
            <h3>All Bookings</h3>

            <table style={styles.table}>
              <thead>
                <tr>
                  <th style={styles.th}>Booking ID</th>
                  <th style={styles.th}>Customer</th>
                  <th style={styles.th}>Flight</th>
                  <th style={styles.th}>Route</th>
                  <th style={styles.th}>Date</th>
                  <th style={styles.th}>Seats</th>
                  <th style={styles.th}>Total ($)</th>
                  <th style={styles.th}>Actions</th>
                </tr>
              </thead>

              <tbody>
                {bookings.map((b) => (
                  <tr key={b.id} style={styles.tr}>
                    <td style={styles.td}>{b.id}</td>
                    <td style={styles.td}>{b.customerName}</td>
                    <td style={styles.td}>{b.flightNo}</td>
                    <td style={styles.td}>{b.from} â†’ {b.to}</td>
                    <td style={styles.td}>{b.date}</td>
                    <td style={styles.td}>{b.seats}</td>
                    <td style={styles.td}>${b.total}</td>

                    <td style={styles.actionCol}>
                      <button 
                        style={styles.viewBtn}
                        onClick={() => handleView(b.id)}
                      >
                        View
                      </button>

                      <button 
                        style={styles.editBtn}
                        onClick={() => handleEdit(b.id)}
                      >
                        Edit
                      </button>

                      <button 
                        style={styles.deleteBtn}
                        onClick={() => handleDelete(b.id)}
                      >
                        Delete
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>

          </div>
        </div>
      </main>
    </div>
  );
}

/*************  STYLES  *************/
const styles = {
  page: {
    fontFamily: "system-ui, sans-serif",
    color: "#111",
  },
  hero: {
    background: "#f6f7fbce",
    padding: "30px 0",
    borderRadius: "20px",
    width: "1200px",
    margin: "20px auto",
    boxShadow: "0 2px 8px rgba(0,0,0,0.05)",
  },
  heroInner: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    gap: 25,
  },
  title: {
    fontSize: 28,
    fontWeight: 700,
  },
  sectionCard: {
    width: "1100px",
    background: "white",
    border: "1px solid #e7ebf0",
    borderRadius: 12,
    padding: 25,
    boxShadow: "0 1px 3px rgba(0,0,0,.05)",
  },

  /** TABLE **/
  table: {
    width: "100%",
    borderCollapse: "collapse",
    marginTop: 15,
  },
  th: {
    textAlign: "left",
    padding: "12px 10px",
    background: "#f0f2f5",
    borderBottom: "1px solid #ddd",
    fontWeight: 600,
  },
  tr: {
    borderBottom: "1px solid #eee",
  },
  td: {
    padding: "12px 10px",
  },
  actionCol: {
    display: "flex",
    gap: 10,
    padding: "12px 10px",
  },

  /** BUTTONS **/
  viewBtn: {
    padding: "6px 12px",
    background: "#4b8ef7",
    color: "white",
    border: "none",
    borderRadius: 6,
    cursor: "pointer",
    fontSize: 13,
  },
  editBtn: {
    padding: "6px 12px",
    background: "#f7b84b",
    color: "white",
    border: "none",
    borderRadius: 6,
    cursor: "pointer",
    fontSize: 13,
  },
  deleteBtn: {
    padding: "6px 12px",
    background: "#e25454",
    color: "white",
    border: "none",
    borderRadius: 6,
    cursor: "pointer",
    fontSize: 13,
  },
};
